import React from 'react'
//import {Restaurant} from './component/Basics/restaurant'; if u r using export const restaurant in restaurant.js
import Boxoffice from './component/Basics/Boxoffice';
import Register from './component/register/register';
import Login from './component/login/login';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import { useState } from 'react';



const App = () => {
  const [user, setLoginUser] = useState({})
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route exact path="/">
            {
              user && user._id ? <Boxoffice setLoginUser={setLoginUser} /> : <Login setLoginUser={setLoginUser} />
            }
          </Route>
          <Route path="/login">
            <Login setLoginUser={setLoginUser} />
          </Route>
          <Route path="/register">
            <Register />
          </Route>
        </Switch>
      </Router>
    </div>
  )}

export default App;
